} else {
  alert("You failed ðŸ˜­");
}

Part 8 - Revealing the Final Score
A simple "pass" or "fail" is nice, but the player might want to know their exact score. There is actually already a  element in the HTML just for this purpose! Its text can update dynamically based on the quiz result.

Make a new line at the bottom of the startQuiz function
There, create a new variable named scoreElement
Set the scoreElement value to get the  element from the HTML
Use document.querySelector to accomplish this


Set the text of the  to a message saying "You got SCORE correct (PERCENT%)"
Use .textContent to accomplish this


Make the message into a template string, and replace "SCORE" and "PERCENT" with ${score} and ${scorePercent}
This will use the actual score and percentage values


Run the project, take the quiz again, and verify that the correct score appears on the page after it!

The added code should look something like this:
let scoreElement = document.querySelector("#score");
scoreElement.textContent = `You got ${score} correct (${scorePercent}%)`;

Part 9 - Presenting the Stars
The quiz is functionally complete now, but the player might want a bit more of a prize for their efforts. Add some star images to the page based on how many questions the player got right!

